import React, {userState} from 'react';
import { Link } from 'react-router-dom';
import logo from '../Responsivo/logo.png'; // Tell webpack this JS file uses this image

function Navbar() {
  return (
        <>
          <nav className="navbar">
              <div className="navbar-container">
                  <Link to="/" className="navbar-logo">
                    <figure>
                      <img src="./public/Responsivo/logo.png" alt="Logo do Portal UFU" />
                    </figure>
                  </Link>
              </div>
          </nav>
        </>
  );
}

export default Navbar;
